import React from 'react'
import { useNavigate } from "react-router-dom";

function Radio(props){
    const navigate = useNavigate()

    function linkContact(){
        navigate("/Contact")
    }

    function linkAboutMe(){
        navigate("/About-Me")
    }

    function linkProject(){
        navigate("/Projects")
    }

    function linkHome(){
        navigate("/")
    }

    return(
        <div class="radio-inputs">
        <label class="radio">
            <input className='rc' type="checkbox" name='Home'  checked={props.HOME}/>
            <span class="name">Home</span>
        </label>

        <label class="radio">
            <input className='rc' type="checkbox" name='AboutMe'  checked={props.YT}/>
            <span class="name">About Me</span>
        </label>

        <label class="radio">
            <input className='rc' type="checkbox"  name='Project' checked={props.AOV}/>
            <span class="name">Projects</span>
        </label>


        <label class="radio">
            <input className='rc' type="checkbox" name='Contact'  checked={props.WNC}/>
            <span class="name">Contact</span>
        </label>

        </div>
    )
}


export default Radio


